script: |
  super -f text -I q10659.spq | sort > q10659.out

inputs:
  - name: q10659.spq
    data: |
      SELECT + col0 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE 58 NOT BETWEEN col0 AND - + col2 - 63 - - 47 + col1 + - col0 + + 70 * 44;
  - name: tab0

outputs:
  - name: q10659.out
    data: |
      87
      97
